import axios from 'axios'

export const Delete = async (id) => {
    await axios.delete(process.env.REACT_APP_API + `/product/${id}`)
}

export const C = async (id) => {
    await axios.delete(process.env.REACT_APP_API + `/product/${id}`)
}
